module.exports = "\n<div class=\"hero-image\"  >\n \n \n    <div dir=\"rtl\" class=\"hero-text\">\n      <div style=\"text-align:center\">\n  <h1   > تبديل الكتب\n  </h1>\n  \n  \n  \n              </div>\n    </div>\n    \n  </div>\n\n\n<div class=\"container pad\" style=\"padding-top:10%;padding-bottom:10%\">\n<div class=\"row\">\n\n\n\n<div class=\"col-sm-5\" dir=\"rtl\" style=\"text-align:right\">\n<h4>الحساب التقريبي للنقاط في الكتاب الواحد (XP) :\n  (معرفة تقييم الكتاب)\n</h4>\n<br>\n\n<h6>ادخل عدد صفحات الكتاب</h6>\n<input type=\"number\" class=\"form-control\">\n<br>\n\n<h6>حدد حالة الكتاب</h6>\n\n<select class=\"form-control\" dir=\"rtl\">\n  <option>\n    حالة الكتاب :\n  </option>\n  <option>\n    مستعمل بحالة جيدة\n  </option>\n  <option>\n    مستعمل بحالة متوسطة\n  </option>\n  <option>\n    مستعمل بحالة مقبولة\n  </option>\n</select>\n<br>\n<h6>حدد نوع الكتاب</h6>\n\n<select class=\"form-control\" dir=\"rtl\">\n  <option>\n    نوع الكتاب :\n  </option>\n  <option>\nرواية\n  </option>\n  <option>\nعلمية  </option>\n  <option>\nسيرة ذاتية  </option>\n</select>\n<br>\n<h6>حدد حجم الكتاب</h6>\n<select class=\"form-control\">\n    <option>\n        حجم الكتاب :\n      </option>\n      <option>\nصغير\n      </option>\n      <option>\n        متوسط\n        </option>\n        <option>\n        كبير\n          </option>\n</select>\n<br>\n\n<h5>تقييم الكتاب : <span class=\" btn btn-success\">= 50 XP</span> \n</h5>\n<span class=\" btn btn-primary\"> اعادة الحساب</span>\n<br>\n<br>\n</div>\n\n<div class= \"col-sm-7\" style=\"padding-left:15%;text-align: justify\" dir=\"rtl\">\n    <h2 style=\"text-align:center;padding-bottom:5%\">تبديل الكتب</h2>\n\n    كلما قمت بتبديل بكتبك أكثر كلما امتلأت مكتبتنا بشتى أنواع الكتب التي ستتسبب بدورها في جذب الكثير من القراء الآخرين الذين بدورهم سيقومون بتبديل بكتبهم وهكذا، ربما لا تجد كتابك المطلوب اليوم ولكن ربما يأتي كتابك الذى قمت بتبديله بالشخص الذي يملك هذا الكتاب ويقوم بتبديله، وبالتالى تحصل على كتابك، وهكذا تكتمل الدائرة.\n\n    بتبديلك للكتب، ستحصل على العملات اللازمة لشراء الكتب الموجودة في موقعنا وهذا هو هدفك الرئيسي من عملية التبديل.\n    \n    أغلبنا يقرأ الكتاب مرة واحدة لذا لا داعي لامتلاء مكتبتك بكتب لن تقرأها ثانية، طالما في مقدورك ان تبدلها مع آخرين و تستفيد منها.\n    \n    بإعادة استخدام كتبك، تنقذ ملايين الأشجار من استخدامها في إنتاج الأوراق الجديدة وآلاف الأطنان من الوقود في تشغيل المصانع المنتجة للورق.\n    \n    بامكانك الآن أن تبدأ عملية التبادل و تنتظر مندوبنا الذي سيأتي إليك في أقرب وقت لأخذ الكتب و من ثم ادخالها إلى مكتبة الموقع و تحصل على عملاتك لتبدأ عملية شراء الكتب من مكتبة بوكابكيا.\n<br>\n<br>\n<hr>\n<h4>\n  ادخل عدد الكتب التي تود تبديلها:\n</h4>\n<form >\n<input type =\"number\" class=\"form-control\">\n<br>\n<!--\n\n\n<mat-radio-group style=\"padding-left:10% !important;font-size:16px !important\" aria-label=\"Select an option\">\n    <mat-radio-button [disabled] value=\"1\">هل تريد الحصول على النقاط من أجل شراء الكتب الآن؟\n      <br>\n       (  الحد الاقصى 12 كتاب - سنلزمك بكتابة معلومات جميع الكتب \n       <br>\n       التي ترغب في تبديلها الأن \n       - قد يتغير التقييم بعد وصول الكتب الينا\n       )\n      \n      </mat-radio-button>\n    <br>\n    <mat-radio-button value=\"2\">الحصول على النقاط بعد وصول موظف التوصيل</mat-radio-button>\n  </mat-radio-group>\n  -->\n<button class=\"btn btn-danger\">اتمام عملية التبديل</button>\n</form>\n</div>\n\n\n\n\n\n\n</div>\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n</div>"

